@StatsForBios Hopefully, a better example

y &lt;- lapply(1:3, function(x) {
  set.seed(42)
  snow::splitIndices(sample(10, size=1), 2)
})

I think any user would expect y[2] and [3] to be identical to y[1], which is *not* the case when you run it *the first time* in a fresh #RStats session

